import{_ as e,c as t,o as a,a1 as o}from"./chunks/framework.DCKU21so.js";const i="/assets/TopBar.D1oRJlQX.png",s="/assets/Work.Bq4D7H2i.png",A="data:image/png;base64,",r="data:image/png;base64,",n="data:image/png;base64,",h="data:image/png;base64,",l="data:image/png;base64,",c="data:image/png;base64,",p="/assets/2.BbsSqy56.png",d="/assets/Properties.BlRgMq2B.png",g="/assets/Layer.GUEd-YU1.png",u="/assets/LayerSet.B_13Srhe.png",m="/assets/leftBBar.bX5ULcOp.png",U=JSON.parse('{"title":"Sheet editor page","description":"","frontmatter":{},"headers":[],"relativePath":"Sheet-editor.md","filePath":"Sheet-editor.md"}'),y={name:"Sheet-editor.md"},E=o('<h1 id="sheet-editor-page" tabindex="-1">Sheet editor page <a class="header-anchor" href="#sheet-editor-page" aria-label="Permalink to &quot;Sheet editor page&quot;">​</a></h1><h2 id="top-bar" tabindex="-1">Top bar <a class="header-anchor" href="#top-bar" aria-label="Permalink to &quot;Top bar&quot;">​</a></h2><p><img src="'+i+'" alt="An image"></p><p>The editor&#39;s top bar is designed to provide quick access to the tool&#39;s essential functions.</p><h3 id="_1-home" tabindex="-1">1. Home <a class="header-anchor" href="#_1-home" aria-label="Permalink to &quot;1. Home&quot;">​</a></h3><p>The &quot;Home&quot; icon takes you back to the main score editor screen. Click here for quick access to your dashboard and other projects without leaving the editor.</p><h3 id="_2-save" tabindex="-1">2. Save <a class="header-anchor" href="#_2-save" aria-label="Permalink to &quot;2. Save&quot;">​</a></h3><p>The &quot;Save&quot; icon lets you save your progress at any time. Frequent saving is recommended to avoid data loss. Clicking on this icon saves your work in progress.</p><h3 id="_3-settings" tabindex="-1">3. Settings <a class="header-anchor" href="#_3-settings" aria-label="Permalink to &quot;3. Settings&quot;">​</a></h3><p>The &quot;Settings&quot; icon opens the configuration menu where you can adjust project parameters.</p><h3 id="_4-export" tabindex="-1">4. Export <a class="header-anchor" href="#_4-export" aria-label="Permalink to &quot;4. Export&quot;">​</a></h3><p>The &quot;Export&quot; icon lets you save your project in JSON formats compatible with various gaming platforms. Click here to export your finished project for sharing or integration into other game development software.</p><h3 id="_5-undo-redo" tabindex="-1">5. Undo/Redo <a class="header-anchor" href="#_5-undo-redo" aria-label="Permalink to &quot;5. Undo/Redo&quot;">​</a></h3><p>The arrow icons allow you to undo (Undo) or redo (Redo) the last actions performed in the editor. Use these buttons to quickly correct errors or return to an earlier version of your work. You can also use the usual keyboard shortcuts, Ctrl+Z to undo and Ctrl+LShift+Z to redo, to save time and work more efficiently.</p><h2 id="workspace" tabindex="-1">Workspace <a class="header-anchor" href="#workspace" aria-label="Permalink to &quot;Workspace&quot;">​</a></h2><p>This is the space for creating and modifying the tool&#39;s graphic elements.</p><p><img src="'+s+'" alt="An image"></p><p>It consists of :</p><h3 id="event-keys" tabindex="-1">Event keys <a class="header-anchor" href="#event-keys" aria-label="Permalink to &quot;Event keys&quot;">​</a></h3><p>Event keys are the tool&#39;s triggers. They are used to record the precise events you want to occur in your project and are currently organized in lines, named by default Line 1, Line 2 and so on. You can change the name of each row in the layer parameters.</p><p><img src="'+A+'" alt="An image"></p><h3 id="the-rhythm-sheet" tabindex="-1">The rhythm sheet <a class="header-anchor" href="#the-rhythm-sheet" aria-label="Permalink to &quot;The rhythm sheet&quot;">​</a></h3><p>This is the space where all events key will be recorded.</p><p><img src="'+r+'" alt="An image"></p><h3 id="event-keys-line-speawner" tabindex="-1">Event keys line speawner <a class="header-anchor" href="#event-keys-line-speawner" aria-label="Permalink to &quot;Event keys line speawner&quot;">​</a></h3><p>This is the line that graphically defines the position of the audio track, and is also the point at which event keys are created when the audio track is on play.</p><p><img src="'+n+'" alt="An image"></p><h3 id="bpm-dancer" tabindex="-1">BPM dancer <a class="header-anchor" href="#bpm-dancer" aria-label="Permalink to &quot;BPM dancer&quot;">​</a></h3><p>It&#39;s there to indicate whether the BPM you enter is consistent with the music on the audio track.</p><p><img src="'+h+'" alt="An image"></p><p><img src="'+l+'" alt="An image"></p><p><img src="'+c+'" alt="An image"></p><h2 id="music-track-bar" tabindex="-1">Music track bar <a class="header-anchor" href="#music-track-bar" aria-label="Permalink to &quot;Music track bar&quot;">​</a></h2><p>The playback bar is used to control the playback of music and rhythm sequences.</p><p><img src="'+p+'" alt="An image"></p><p>Here are a few common functions that the playback bar contains:</p><h3 id="_1-playback-position" tabindex="-1">1. Playback position <a class="header-anchor" href="#_1-playback-position" aria-label="Permalink to &quot;1. Playback position&quot;">​</a></h3><p>A visual indicator showing the current playback position in the track or sequence.</p><h3 id="_2-play-pause" tabindex="-1">2. Play/Pause <a class="header-anchor" href="#_2-play-pause" aria-label="Permalink to &quot;2. Play/Pause&quot;">​</a></h3><p>A button to start or stop music or rhythm sequence playback.</p><h3 id="_3-fast-forward-and-fast-rewind" tabindex="-1">3. Fast Forward and Fast Rewind <a class="header-anchor" href="#_3-fast-forward-and-fast-rewind" aria-label="Permalink to &quot;3. Fast Forward and Fast Rewind&quot;">​</a></h3><p>Buttons for fast navigation within the track or sequence.</p><h3 id="_4-playback-slider" tabindex="-1">4. Playback slider <a class="header-anchor" href="#_4-playback-slider" aria-label="Permalink to &quot;4. Playback slider&quot;">​</a></h3><p>A visual indicator showing the current playback position in the track or sequence too.</p><h3 id="_5-stop" tabindex="-1">5. Stop <a class="header-anchor" href="#_5-stop" aria-label="Permalink to &quot;5. Stop&quot;">​</a></h3><p>A button to stop playback and return to the beginning of thetrack or sequence.</p><h3 id="_6-playback-speed-control" tabindex="-1">6. Playback Speed Control <a class="header-anchor" href="#_6-playback-speed-control" aria-label="Permalink to &quot;6. Playback Speed Control&quot;">​</a></h3><p>Buttons to adjust playback speed, allowing you to slow down or speed up the music or rhythm sequence.</p><h2 id="event-keys-properties" tabindex="-1">Event keys properties <a class="header-anchor" href="#event-keys-properties" aria-label="Permalink to &quot;Event keys properties&quot;">​</a></h2><p><img src="'+d+'" alt="An image"></p><p>The Event Key Properties panel in Rhythm Sheet Editor is a tool that gives users precise control over the event keys in their projects. With this panel, users can view and modify the specific properties of selected event keys.</p><h3 id="_1-hold-note" tabindex="-1">1. Hold note <a class="header-anchor" href="#_1-hold-note" aria-label="Permalink to &quot;1. Hold note&quot;">​</a></h3><p>The note length setting field allows users to define the duration or length of the note associated with the selected event key.</p><h3 id="_2-edit-buttons" tabindex="-1">2. Edit Buttons <a class="header-anchor" href="#_2-edit-buttons" aria-label="Permalink to &quot;2. Edit Buttons&quot;">​</a></h3><ul><li><p>The <strong>“Delete”</strong> button allows users to quickly delete the selected event key.</p></li><li><p>The <strong>“Snap”</strong> option allows users to control the precise alignment of event keys in relation to a grid or specific landmarks in the editor.</p></li></ul><h2 id="layers" tabindex="-1">Layers <a class="header-anchor" href="#layers" aria-label="Permalink to &quot;Layers&quot;">​</a></h2><p><img src="'+g+'" alt="An image"></p><p>The Layer Panel in Rhythm Sheet Editor is an essential tool that enables users to manage and organize multiple event key chains in their projects.</p><h3 id="_1-layer-selection" tabindex="-1">1. Layer selection <a class="header-anchor" href="#_1-layer-selection" aria-label="Permalink to &quot;1. Layer selection&quot;">​</a></h3><p>Users can quickly select the layer they wish to work on, enabling them to view and modify layer-specific event keys.</p><h3 id="_2-add-new-layer" tabindex="-1">2. Add new layer <a class="header-anchor" href="#_2-add-new-layer" aria-label="Permalink to &quot;2. Add new layer&quot;">​</a></h3><p>This function allows users to add new layers to organize their event keys into logical or thematic groups. Users can create as many layers as they wish for flexible organization of their events.</p><h3 id="_3-layer-settings" tabindex="-1">3. Layer settings <a class="header-anchor" href="#_3-layer-settings" aria-label="Permalink to &quot;3. Layer settings&quot;">​</a></h3><p><img src="'+u+'" alt="An image"></p><p><strong>Change Layer Name:</strong> Users can change the name of each layer for easy identification and efficient organization.</p><p><strong>Change Name of each Event Key Row:</strong> Provides the ability to change the name of each row of event keys within a layer for better understanding and organization.</p><p><strong>Change Event Key Color:</strong> Lets users customize the color of event keys in a layer for quick visual identification and distinction between events.</p><p><strong>Hide Layer:</strong> Offers the option of hiding a layer to hide all associated events in the editor, simplifying the viewing and editing of other layers.</p><h2 id="mappings-list" tabindex="-1">Mappings list <a class="header-anchor" href="#mappings-list" aria-label="Permalink to &quot;Mappings list&quot;">​</a></h2><p><img src="'+m+'" alt="An image"></p><h3 id="_1-mapping-list-time-keys" tabindex="-1">1. Mapping list (Time &amp; Keys) <a class="header-anchor" href="#_1-mapping-list-time-keys" aria-label="Permalink to &quot;1. Mapping list (Time &amp; Keys)&quot;">​</a></h3><p>The mapping list displays the times and keys associated with each event in the score. This section allows you to view and fine-tune the timing of notes and their corresponding keys.</p><h3 id="_2-show-bpm-grid-option" tabindex="-1">2. Show BPM Grid&quot; option <a class="header-anchor" href="#_2-show-bpm-grid-option" aria-label="Permalink to &quot;2. Show BPM Grid&quot; option&quot;">​</a></h3><p>The &quot;Show BPM Grid&quot; checkbox lets you show or hide the beats-per-minute (BPM) grid in the main editing area. Showing this grid helps to visualize musical bars, making it easier to align notes with musical beats, ensuring better synchronization with the rhythm.</p><h3 id="_3-snap-key-events-option" tabindex="-1">3. Snap Key Events&quot; option <a class="header-anchor" href="#_3-snap-key-events-option" aria-label="Permalink to &quot;3. Snap Key Events&quot; option&quot;">​</a></h3><p>The &quot;Snap Key Events&quot; option enables or disables the automatic alignment of key events on the grid. This function helps ensure that notes are placed precisely on the defined beats, which is crucial for maintaining the rhythm and playability of rhythm playing.</p><h3 id="_4-bpm-parameters" tabindex="-1">4. BPM parameters <a class="header-anchor" href="#_4-bpm-parameters" aria-label="Permalink to &quot;4. BPM parameters&quot;">​</a></h3><p>The BPM settings let you define the beats per minute of the music track. By setting the music&#39;s tempo, you can synchronize game events correctly with the musical rhythm.</p><h3 id="_5-rhythm-signature-sign-rhythm" tabindex="-1">5. Rhythm signature (Sign Rhythm) <a class="header-anchor" href="#_5-rhythm-signature-sign-rhythm" aria-label="Permalink to &quot;5. Rhythm signature (Sign Rhythm)&quot;">​</a></h3><p>The rhythm signature defines the rhythmic structure of the music. This helps to organize notes into appropriate measures, respecting the structure of the music and facilitating the creation of a coherent, well-structured score.</p><h3 id="_6-tempo-song-option" tabindex="-1">6. Tempo Song&quot; option <a class="header-anchor" href="#_6-tempo-song-option" aria-label="Permalink to &quot;6. Tempo Song&quot; option&quot;">​</a></h3><p>The &quot;Tempo Song&quot; option synchronizes song playback speed with the set tempo. This ensures that song playback follows the tempo you set, allowing tempo adjustments without altering the pitch of the music.</p><h3 id="_7-volume-slider" tabindex="-1">7. Volume slider <a class="header-anchor" href="#_7-volume-slider" aria-label="Permalink to &quot;7. Volume slider&quot;">​</a></h3><p>The volume slider offers quick and easy control over the volume of the audio track.</p><h3 id="_8-music-speed-options" tabindex="-1">8. Music speed options <a class="header-anchor" href="#_8-music-speed-options" aria-label="Permalink to &quot;8. Music speed options&quot;">​</a></h3><p>The music speed buttons allow you to adjust the speed at which music is played (0.5X, 0.8X, 1X, 1.5X). Listening to music at different speeds is useful for checking the synchronization of notes with the rhythm, or for placing notes over fast music</p>',86),B=[E];function Q(k,b,f,C,w,I){return a(),t("div",null,B)}const J=e(y,[["render",Q]]);export{U as __pageData,J as default};
